textOriginal:
@Thiago As vezes fico pensando? 🤔
_ Será que que é verdade tudo isto que está acontecendo? Será  que é verdade que um dos mais importantes ministério está sendo ministrado por uma louca, insana, falsa?
Será que todos os militares de todas as forças armadas do país não se lembram do que este presidente fez qdo serviu o exército? Não vêm que ele é um mal exemplo para os militares? Será  que este presidente  que derruba todas as formas de educação, respeito, dignidade, liberdade, formalidade, diplomacia ainda está lá  diserminando ódio, desrespeito a tudo e a todos? Ninguém vê, ninguém faz nada... Nosso país é tão maravilhoso, e ninguém percebe que  este homem está acabando com tudo, colocando uns contra os outros?  Um presidente que se diz cristão e zela pelas familias, mas maltrata mulheres, vende armas, desrespeita religiões e povos. Transformou nossa bandeira linda que representava tantas coisas maravilhosas de nosso país  em uma bandeira medo, até mesmo de um certo nojo. Estou muito indignada e cansada de ver tanta coisa errada, de ver nosso país sendo ridicularizado perante o mundo todo. Estou triste e envergonhada, vergonha alheia por ter este homem como presidente de um país abençoado por Deus como este nosso Brasil
